import React, {useState, useEffect} from 'react';
import {Link, useParams, useNavigate} from 'react-router-dom';
import DogService from "../services/dog.service";

const ShowDogDetails = () =>{
    const[dog, setDog]=useState({});
    const{id} = useParams();
    const navigate = useNavigate();

    useEffect(()=>{
        DogService.getDog(id).then((res)=>setDog(res.data))
        .catch((err)=>console.log("error form get dog details"));
    },{id})
    const onDelete=(id)=>{
        DogService.deleteDog(id).then((res)=>navigate('/user'))
        .catch((err)=>console.log("error form get delte dogs"));
    }
    const onUpdate =(id)=>{
        navigate('/update-dog/'+id)
    }
    return(
        <div>
            <table className='table table-hover table-dark'>
            <tbody>
              <tr>
                <th scope='row'>1</th>
                <td>Name</td>
                <td>{dog.dogName}</td>
              </tr>
              <tr>
                <th scope='row'>2</th>
                <td>Age</td>
                <td>{dog.dogAge}</td>
              </tr>
              <tr>
                <th scope='row'>3</th>
                <td>Breed</td>
                <td>{dog.dogBreed}</td>
              </tr>
              <tr>
                <th scope='row'>4</th>
                <td>Size</td>
                <td>{dog.dogSize}</td>
              </tr>
              <tr>
                <th scope='row'>5</th>
                <td>Temperament</td>
                <td>{dog.dogTemperament}</td>
              </tr>
             
            </tbody>
          </table>
          <div className='dog-actions'>
        <button className="btn btn-outline-danger btn-lg btn-block" onClick={()=>{onDelete(dog._id)}}>Delete</button>
        
        <button className='btn btn-outline-info btn-lg btn-block' onClick={()=>{onUpdate(dog._id)}}>Edit</button>
      </div>
        </div>
    )
}

export default ShowDogDetails;
